Alright, let's delve into this a bit, shall we?

&amp;#x200B;

UTI's - This was a single study in 1985.... Since then, additional studies show no increase in risk of UTI's between circumcised and uncircumcised. Ref: Thompson 1990

&amp;#x200B;

Phimosis - Can't diagnose in a young child, since it's part of the normal process for the foreskin to be attached.  Forced detachment leads to issues, including some listed below.  Pathological Phimosis happens in 0.6% of boys, or 0.4 in 1000 by the age of 15.  Ref: Phimosis in Children, 2012

&amp;#x200B;

Reduces AIDS/HIV - Flawed studies in Africa in 2005, 2006, did not complete the studies before showing results.  HIV spread in the USA when most men were circumcised... It's also spread less by intercourse and more by needles, blood in the USA.  Recent study shows no difference between circumcised and uncircumcised. Ref: Connolly 2008, Wawer 2009, Jameson 2009

&amp;#x200B;

Balanitis - 1 in 30 impacted in their lifetime.  This is primarily due to a lack of good hygiene of the penile area, and clears up within 3-5 days with treatment.

&amp;#x200B;

Balanoposthitis - 12-20% of uncircumcised males experience this.  While infection, trauma, and cancer can cause this, the leading cause is poor hygiene.  Wash your junk correctly.  Ref: Balanoposthitis: Oswald S. Perkins; Sara Cortes. 2020

&amp;#x200B;

Protection against penile cancer - Sure, if you're in an underdeveloped country... This isn't an issue in developed countries.  In the USA it is &lt;1% of all malignancies in men and 0.1% of cancer deaths.  You'd need to circumsize 300,000 kids to save 1 from cancer. 

&amp;#x200B;

Reduce risk of cervical cancer in women - Based on a study in Uganda in conjunction with HIV RCTs.  Self-sampling, no actual reporting of cervical cancer as an outcome, lead-time bias and a high rate of loss to follow-up.  Since then, 16 studies have attempted to connect cervical cancer in women and the circumcision status of their male partners.  None of them have succeeded.  Even the often cited Castellsagué et al. failed to show a significant association.  

Ref: Castellsagué X, Bosch FX, Muñoz N, Meijer CJ, Shah KV, de Sanjose S, et al. Male circumcision, penile human papillomavirus infection, and cervical cancer in female partners. N Engl J Med. 2002;346:1105-12.

Ref: Connon AF. Cancer detection survey gynaecological and epidemiological data. Med J Aust. 1972;1:738-41.

Ref: Aitken-Swan J, Baird D. Cancer of the uterine cervix in Aberdeenshire. Aetiological aspects. Br J Cancer. 1966;20:642-59.

Ref: Abou-Daoud KT. Epidemiology of carcinoma of the cervix uteri in Lebanese Christians and Moslems. Cancer. 1967;20:1706-14.

.... and 12 others.

&amp;#x200B;

&amp;#x200B;

To boil it down, circumcision is for appearances or religion... unless you're in an underdeveloped country.  Teach good hygiene.  Wash your junk.
